    "The resulting alignment(s) is (are) optimized for this value of mean pairwise identity (in percent, default: 80)": "生成的对齐（对齐结果）针对平均配对一致性（以百分比表示，默认值：80%）这个值进行了优化。",
    "Sequences from pairs with pairwise identity higher than X% are removed (default: 99, i.e. only almost identical sequences areremoved)": "序列对中相似度高于X%的序列被移除（默认：99，即只有几乎相同的序列被移除）",
    "By default the first sequence (=reference sequence) is always present in the output alignment(s). If you do not care having it removed, set this flag.": "默认情况下，第一个序列（=参考序列）始终包含在输出对齐中。如果你不介意将其删除，请设置此标志。",
