    "Discard alignment windows with an overall mean pairwise identity smaller than X%. (Default: 50)": "丢弃整体平均配对比对相似度小于X%的比对窗口。（默认值：50）",
    "Minimum number of sequences in an alignment. Discard any windows with less than N sequences (Default:2)": "对齐中序列的最小数量。丢弃任何少于N个序列的窗口（默认值：2）",
    "Maximum number of sequences in an alignment. Discard any windows with less than N sequences (Default:6)": "在一个比对中的最大序列数。丢弃任何少于N个序列的窗口（默认值：6）",
    "Number of different subsets of sequences that is sampled if there are more sequences in the alignment than --max-seqs (Default: 1)": "如果比对中的序列数量超过 --max-seqs（默认值：1），则采样的不同序列子集的数量",
    "Minimum number of columns of an alignment slice. After removing sequences from the alignment, all-gap columns are removed. If the resulting alignment has fewer than N columns, the complete alignment is discarded.": "对齐切片的最小列数。在从对齐中移除序列后，所有间隙列将被移除。如果结果对齐的列数少于N，则整个对齐将被丢弃。",
    "If the number of sequences has to be reduced (see --max-seqs) a subset of sequences is chosen which is optimized for this value of mean pairwise identity. (In percent, default: 80)": "如果需要减少序列的数量（参见--max-seqs），则选择一个子集的序列，该子集针对平均配对同一性值进行优化。（以百分比表示，默认值：80）",
    "Scored strand": "得分链",
    "By default the first sequence is interpreted as reference sequence. This means, for example, that if the reference sequence is removed during filtering steps the complete alignment is discarded. Also, if there are too many sequences in the alignment, the reference sequence is never removed when choosing an appropriate subset. Having a reference sequence is crucial if you are doing screens of genomic regions. For some other applications it might not be necessary and in such cases you can change the default behaviour by setting this option.": "默认情况下，第一个序列被解释为参考序列。这意味着，例如，如果在过滤步骤中删除了参考序列，则整个比对被丢弃。此外，如果在比对中序列太多，在选择适当子集时，参考序列永远不会被删除。如果您正在筛选基因组区域，拥有参考序列至关重要。对于其他一些应用，可能没有必要，而在这种情况下，您可以通过设置此选项来更改默认行为。",
