    "penalty term for the fitting of the intensity:If it gets negative during the fitting it can be penalized": "强度拟合的惩罚项：如果在拟合过程中变为负数，可以对其进行惩罚。",
    "penalty term for the fitting of the left width:If the left width gets too broad or negative during the fitting it can be penalized": "拟合左侧宽度的惩罚项：如果左侧宽度在拟合过程中变得太宽或为负，则可以对其进行惩罚",
    "penalty term for the fitting of the right width:If the right width gets too broad or negative during the fitting it can be penalized": "拟合合适宽度的惩罚项：如果在拟合过程中合适的宽度变得过大或为负，则可以对其进行惩罚。",
