    "Desired (absolute) m/z accuracy for lossy compression": "期望的（绝对）m/z精度用于有损压缩",
    "Whether to process the file on the fly without loading the whole file into memory first (only for conversions of mzXML/mzML to mzML)": "是否在不先将整个文件加载到内存中的情况下即时处理文件（仅适用于将mzXML/mzML转换为mzML）",
    "Disables vendor peak picking for raw files": "禁用原始文件的供应商峰值选择",
    "The number of peaks to keep": "保留峰值的数量",
