    "List of peptide sequences (mutually exclusive to 'in')": "肽序列列表（与“in”互斥）",
    "Output format ('list': human-readable list, 'table': CSV-like table, 'mass_only': mass values only, 'mz_only': m/z values only)": "输出格式 ('list': 可读列表, 'table': 类似CSV的表格, 'mass_only': 仅质量值, 'mz_only': 仅m/z值)",
    "Compute average (instead of monoisotopic) peptide masses": "计算平均肽质量（而不是单一同位素肽质量）",
