    "If input is paired, the number will be of pairs for which both reads are unmapped": "如果输入是配对的，那么这个数字将表示两个读段都未映射的配对数",
    "The 'Not sorted' option can significantly extend the run time of the tool (it runs using a single thread)": "“未排序”选项可能会显著延长工具的运行时间（它使用单个线程运行）",
