    "READ_NAME_REGEX; Read names are parsed to extract three variables: tile/region, x coordinate and y coordinate. These values are used to estimate the rate of optical duplication in order to give a more accurate estimated library size. See help below for more info; default='' (uses : separation)": "读取名称正则表达式；读取名称被解析以提取三个变量：平铺/区域，X坐标和Y坐标。这些值用于估计光学重复率，以给出更准确的估计库大小。有关更多信息，请参见下面的帮助；默认值为''（使用冒号分隔）。",
    "Barcode SAM tag. This tag can be utilized when you have data from an assay that includes Unique Molecular Indices. Typically 'RX'": "条形码 SAM 标签。当您拥有包含唯一分子索引的分析数据时，可以使用此标签。通常为 'RX'",
    "MINIMUM_DISTANCE; Set this number to -1 to use twice the first read's read length (or 100, whichever is smaller); default=-1": "最小距离；将此数字设置为-1以使用第一个读段长度的两倍（或100，以较小者为准）；默认值=-1",
