    "The set of alleles at which to genotype": "在哪些等位基因上进行基因分型",
    "Population vcf of germline sequencing containing allele fractions.": "包含等位基因分数的种系测序群体vcf。",
    "LOD threshold to consider pileup active.": "考虑成堆的LOD阈值。",
    "Amount of padding (in bp) to add to each interval you are excluding": "要排除的每个区间添加的填充量（以碱基对为单位）",
    "Amount of padding (in bp) to add to each interval you are including": "要在包含的每个区间中添加的填充量（以碱基对为单位）",
    "Interval merging rule for abutting intervals": "相邻区间合并规则",
    "Set merging approach to use for combining interval inputs": "设置用于合并区间输入的合并方法",
    "Lenient processing of VCF files": "宽松处理 VCF 文件",
    "Maximum population allele frequency in tumor-only mode.": "在肿瘤特有模式下，最大人群等位基因频率。",
    "Maximum number of reads to retain per alignment start position. Reads above this threshold will be downsampled. Set to 0 to disable.": "每个比对起始位置保留的最大读取数。超过此阈值的读取将被下采样。设置为0以禁用。",
    "Minimum base quality required to consider a base for calling": "用于调用的最小碱基质量要求",
