    "LOD threshold for calling normal variant non-germline.": "用于调用正常变异非生殖细胞的LOD阈值。",
    "BAM sample name of normal.  May be URL-encoded as output by GetSampleName with -encode argument.": "正常样本的BAM名称。可能被URL编码，如使用-encode参数的GetSampleName输出。",
