    "If true, don't emit genotype fields when writing vcf file output.": "如果为真，在写入vcf文件输出时不发射基因型字段。",
    "Validation stringency for all SAM/BAM/CRAM/SRA files read by this program.  The default stringency value SILENT can improve performance when processing a BAM file in which variable-length data (read, qualities, tags) do not otherwise need to be decoded.": "此程序读取的所有SAM/BAM/CRAM/SRA文件的验证严格度。默认的严格度值SILENT可以在处理BAM文件时提高性能，其中不需要对可变长度数据（读取、质量、标签）进行解码。",
    "If true, don&apos;t emit genotype fields when writing vcf file output.": "如果为真，在写入vcf文件输出时，不发射基因型字段。",
    "LOD threshold to emit tumor variant to VCF.": "LOD阈值，用于将肿瘤变异输出到VCF文件中。",
    "Number of overlapping bases around the variant.": "变异周围的重叠碱基数量。",
    "Minimum probability for a locus to be considered active.": "一个位点被认为是活跃的最小概率。",
    "Allow graphs that have non-unique kmers in the reference": "允许在参考中包含非唯一k-mers的图形",
    "Number of additional bases of context to include around each assembly region": "每个组装区域周围要包含的额外碱基对的数目",
    "Which haplotypes should be written to the BAM": "哪些单倍型应该写入BAM文件",
    "Disable the adaptive algorithm for pruning paths in the graph": "禁用图中修剪路径的自适应算法",
    "Disable all tool default annotations": "禁用所有工具默认注释",
    "WARNING: many tools will not function correctly without their default read filters on": "警告：许多工具如果没有启用它们的默认读取过滤器，将无法正常工作。",
