    "Use all possible annotations (not for the faint of heart)": "使用所有可能的注释（不适合胆小的人）",
    "If selected, all regions will be marked as active": "如果选中，所有区域将被标记为活跃",
    "Force-call filtered alleles included in the resource specified by --alleles": "在由 --alleles 指定的资源中包含的过滤等位基因被强制调用",
    "Exclusive upper bounds for reference confidence LOD bands (must be specified in increasing order)": "参考置信度LOD区间的独占上限（必须按递增顺序指定）",
    "Allow paired reads to independently support different haplotypes. Useful for validations with ill-designed synthetic data": "允许配对的读取独立支持不同的单倍型。对于使用设计不良的合成数据进行验证非常有用。",
    "Kmer size to use in the read threading assembler": "在读取线程组装器中使用的Kmer大小",
    "Maximum size of an assembly region": "组装区域的最大大小",
    "Two or more phased substitutions separated by this distance or less are merged into MNPs.": "两个或两个以上相距此距离或更短的相位替换被合并为多核苷酸多态性（MNPs）。",
    "Maximum number of haplotypes to consider for your population": "考虑您人群的最大单倍型数量",
    "Upper limit on how many bases away probability mass can be moved around when calculating the boundaries between active and inactive assembly regions": "在计算活性和非活性组装区域边界时，可以移动概率质量的上限是多少个碱基",
    "Maximum number of suspicious reads (mediocre mapping quality or too many substitutions) allowed in a downsampling stride.  Set to 0 to disable.": "在一个下采样步长中允许的可疑读段（平庸的映射质量或过多的替换）的最大数量。设置为0以禁用。",
    "Maximum number of variants in graph the adaptive pruner will allow": "自适应剪枝器允许图中变异的最大数量",
    "Minimum size of an assembly region": "组装区域的最小大小",
    "Minimum length of a dangling branch to attempt recovery": "尝试恢复悬挂分支的最小长度",
    "Minimum support to not prune paths in the graph": "在图中不修剪路径的最小支持度",
    "Lower bound of variant allele fractions to consider when calculating variant LOD": "在计算变异LOD时考虑的变异等位基因分数的下限",
    "Number of samples that must pass the minPruning threshold": "必须通过最小修剪阈值的样本数",
    "Flat gap continuation penalty for use in the Pair HMM": "在配对隐马尔可夫模型中使用的平坦间隙延续惩罚",
    "The PairHMM implementation to use for genotype likelihood calculations": "用于计算基因型可能性的PairHMM实现",
