    "Columns must be in a specific order, see help documentation": "列必须按照特定顺序排列，请参阅帮助文档",
    "E.g. proc natl acad sci u s a": "例如，美国国家科学院院刊",
    "Used to match input results to NCBI's output": "用于将输入结果与NCBI的输出进行匹配",
    "One ID in each line.": "每行一个ID。",
